// BookingForm.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BookingForm = () => {
  const [selectedBooking, setSelectedBooking] = useState(null);

  useEffect(() => {
    const fetchSelectedBooking = async () => {
      // Fetch the selected booking data from the backend
      const response = await axios.get('http://localhost:3001/api/bookings/last'); // Adjust the API endpoint as needed
      setSelectedBooking(response.data);
    };

    fetchSelectedBooking();
  }, []);

  return (
    <div>
      <h2>Booking Form</h2>
      {selectedBooking && (
        <div>
          <p>Weekday: {selectedBooking.weekday}</p>
          <p>Departure: {selectedBooking.departure}</p>
          <p>Arrival: {selectedBooking.arrival}</p>
          <p>Aircraft: {selectedBooking.aircraft}</p>
          {/* Add other fields as needed */}
        </div>
      )}
    </div>
  );
};

export default BookingForm;
